import React from "react";
import style from "./summary.module.css";
import Images from "../images/Images";

function summary() {
  return (
    <div class="container">
      <div class="col">
        <div class="col-md-3" className={style["card-like"]}>
          ttt
        </div>
        <div class="col-md-6" className={style["card-like"]}>
          sss
        </div>
        <div class="col-md-3" className={style["card-like"]}>
          <Images />
        </div>
      </div>
    </div>
  );
}
export default summary;
